import React from 'react';
import Paper from '@material-ui/core/Paper';
import Header from '../Header';

import Summary from '../Summary';

const Main = () => (
  <div>
    <Header />
    <div>
      <Paper>
        <h2>MAIN CONTENT</h2>
      </Paper>
    </div>
        <Summary />
  </div>
);

export default Main;
